import { View, Text, Image } from 'react-native'
import React from 'react'
import { SafeAreaView } from 'react-native-safe-area-context'
import { COLORS, icons } from '../constants';

const Profile = () => {
  return (
    <SafeAreaView>
      <Text style={{
            fontSize: 25,
            fontWeight: "bold",
            color: COLORS.black,
            marginTop: 20,
            marginLeft: 10,
            height: 50}}>Profile
        </Text>
        <View style={{
          backgroundColor:'red',
          marginLeft:10,
          marginRight:10

        }}>
          <Image
            source={icons.picture}
            resizeMode='contain'
            style={{
              height: 50,
              width: 50,
              tintColor: COLORS.black,
            }}
          />
        </View>

    </SafeAreaView>
  )
}

export default Profile
